func TestStaticDelegatorByMonthTask_Caculate(t *testing.T) {
	task := new(StaticDelegatorByMonthTask)
	serv := new(service.CaculateService)

	// get period txs
	starttime, err := time.ParseInLocation(types.TimeLayout, fmt.Sprintf("%d-%02d-%02dT00:00:00", 2020, 4, 1), cstZone)
	if err != nil {
		t.Fatal(err.Error())
	}
	endtime, err := time.ParseInLocation(types.TimeLayout, fmt.Sprintf("%d-%02d-%02dT00:00:00", 2020, 4, 5), cstZone)
	if err != nil {
		t.Fatal(err.Error())
	}
	txs, err := task.getPeriodTxByAddress(starttime, endtime, "")
	if err != nil {
		t.Fatal(err.Error())
	} else {
		t.Logf("len tx: %d\n", len(txs))
	}

	// get 0409 delegator rewards
	date, err := time.ParseInLocation(types.TimeLayout, fmt.Sprintf("%d-%02d-%02dT00:00:00", 2020, 4, 4), cstZone)
	if err != nil {
		logger.Fatal("convert to date fail")
	}
	rewards, err := task.staticModel.GetDataByDate(date)
	if err != nil {
		logger.Fatal("get data by date fail")
	}
	delegatorRewards := make(map[string]document.ExStaticDelegator)
	for _, v := range rewards {
		if v.Address == conf.Get().Server.FoundationDelegatorAddr {
			time.Sleep(2 * time.Second)
		}
		delegatorRewards[v.Address] = v
	}

	dbstarttime := fmt.Sprintf("%d.%02d.%02d", 2020, 4, 10)
	dbendtime := fmt.Sprintf("%d.%02d.%02d", 2020, 5, 1)

	cond := bson.M{}
	cond["date"] = bson.M{
		"$gte": dbstarttime,
		"$lt":  dbendtime,
	}
	var delegatorMonthData []vo.ExStaticDelegatorMonthVo
	var vaidatorMonthData []vo.ExStaticValidatorMonthVo
	page := 1
	limit := 100
	for {
		res, _, err := serv.GetDelegatorCaculateMonth(cond, page, limit, false)
		if err != nil {
			t.Log(err.Error())
			break
		}
		delegatorMonthData = append(delegatorMonthData, res...)
		if len(res) < limit {
			break
		}
		page++
	}

	for i, val := range delegatorMonthData {
		if data, ok := task.AddressCoin[val.Address]; ok {
			delegatorMonthData[i].PeriodWithdrawRewards += data.Amount / math.Pow10(18)
		}

		var firstDelegationReward float64
		if v, ok := delegatorRewards[val.Address]; ok && len(v.DelegationsRewards) > 0 {
			if len(v.Commission) > 0 {
				firstDelegationReward = v.Total[0].Iris - v.Commission[0].Iris
			} else {
				firstDelegationReward = v.Total[0].Iris
			}
		}
		delegatorMonthData[i].PeriodIncrementRewards = val.TerminalRewards + delegatorMonthData[i].PeriodWithdrawRewards - firstDelegationReward
	}
	bytedata, _ := json.Marshal(delegatorMonthData)
	t.Log(string(bytedata))

	page = 1
	for {
		res, _, err := serv.GetValidatorCaculateMonth(cond, page, limit, false)
		if err != nil {
			t.Log(err.Error())
			break
		}
		vaidatorMonthData = append(vaidatorMonthData, res...)
		if len(res) < limit {
			break
		}
		page++
	}

	for i, val := range vaidatorMonthData {
		if data, ok := task.AddrPeriodCommission[val.Address]; ok {
			vaidatorMonthData[i].PeriodCommission += data.Amount / math.Pow10(18)
		}

		var firstCommissionReward float64
		if v, ok := delegatorRewards[val.Address]; ok && len(v.Commission) > 0 {
			firstCommissionReward = v.Commission[0].Iris
		}
		vaidatorMonthData[i].IncrementCommission = val.TerminalCommission + vaidatorMonthData[i].PeriodCommission - firstCommissionReward
	}
	valbytedata, _ := json.Marshal(vaidatorMonthData)
	t.Log(string(valbytedata))

	//num, _ := task.getPeriodDelegationTimes(addr, txs)
}

func TestUniqueDelegatorByMonthTask_Caculate(t *testing.T) {
	serv := new(service.CaculateService)

	getDelegatorMonthData := func(caculateTime string) []vo.ExStaticDelegatorMonthVo {

		cond := bson.M{
			"date": caculateTime,
		}

		var delegatorMonthData []vo.ExStaticDelegatorMonthVo
		page := 1
		limit := 100
		for {
			res, _, err := serv.GetDelegatorCaculateMonth(cond, page, limit, false)
			if err != nil {
				t.Log(err.Error())
				break
			}
			delegatorMonthData = append(delegatorMonthData, res...)
			if len(res) < limit {
				break
			}
			page++
		}
		return delegatorMonthData
	}

	getUniqMonthData := func(delegatorMonthData []vo.ExStaticDelegatorMonthVo) []vo.ExSumDelegatorMonthVo {
		var (
			result   []vo.ExSumDelegatorMonthVo
			nameAddr = map[string]string{
				"iaa1w7ewedr57z6p7f8nknmdvukfxwkwlsvfjumdts": "生态基金委托地址",
				"iaa156lnmahxx53yxduxax7pu6rdf6dy44edejtnpk": "Bianjie 委托地址",
				"iaa1p3ucd3ptpw902fluyjzhq3ffgq4ntddad8svnp": "Binance Pool 委托地址",
				"iaa1nvx4c38jq4nq9c5na732hdvz4uqx2px7mtc6g9": "Hashquark 委托地址",
				"iaa106j6vl59622cqus8hk5dlc5m3q0h3c5lneqycr": "Huobi Pool 委托地址",
				"iaa1gu0mkhx3w76wz3v2pd0vscsm94zu3htgxej87k": "ICF",
				"iaa16r4q4sfpyhuxk8lg3h3vc03j35knc3akjc05za": "Tendermint",
			}
		)
		Name := "其他地址"
		other := vo.ExSumDelegatorMonthVo{
			Description:            Name,
			Address:                "Other",
			Date:                   "",
			PeriodIncrementRewards: 0,
			TerminalDelegation:     0,
			IncrementDelegation:    0,
		}
		for _, val := range delegatorMonthData {
			switch val.Date {
			case "2020.05.30":
				val.Date = "2020.06.01"
			case "2020.08.31":
				val.Date = "2020.09.01"
			}
			val.Date = string([]byte(val.Date)[:len(val.Date)-3])
			val.Date = strings.ReplaceAll(val.Date, ".", "-")
			desc, ok := nameAddr[val.Address]
			if ok {
				result = append(result, vo.ExSumDelegatorMonthVo{
					Description:            desc,
					Address:                val.Address,
					Date:                   val.Date,
					PeriodIncrementRewards: val.PeriodIncrementRewards,
					TerminalDelegation:     val.TerminalDelegation,
					IncrementDelegation:    val.IncrementDelegation,
				})
			} else {
				if other.Date == "" {
					other.Date = val.Date
				}
				other.IncrementDelegation += val.IncrementDelegation
				other.TerminalDelegation += val.TerminalDelegation
				other.PeriodIncrementRewards += val.PeriodIncrementRewards
			}
		}

		result = append(result, other)

		return result
	}

	var res []vo.ExSumDelegatorMonthVo
	for _, val := range []string{
		"2020.04.09",
		"2020.05.01",
		"2020.05.30",
		"2020.07.01",
		"2020.08.01",
		"2020.08.31",
		"2020.10.01",
		"2020.11.01",
		"2020.12.01",
		"2021.01.01",
	} {
		data := getUniqMonthData(getDelegatorMonthData(val))
		res = append(res, data...)
	}

	bytedata, _ := json.Marshal(res)
	t.Log(string(bytedata))

}

